const RangeFilters = ({options}) => {
    // console.log(options)
    return (
        <div>
            {options.map((option) => (
                <div>
                <input type="checkbox" name="" id="" />
                <p>option</p>
                </div>
            ))}
        </div>
    )
}

export default RangeFilters
